	public static List<ReportDetail> getCollection(){
		List<SvtInfo> lists=new ArrayList();
		for (int i=0;i<3;i++){
			SvtInfo info=new SvtInfo();
			if (i==0){
				info.setEventName("Longest Pause");
			    info.setDuration("2 secs");
			}
			if (i==1){
				info.setEventName("Second Longest Pause");
			    info.setDuration("15 secs");
			}
			if (i==2){
				info.setEventName("Third Longest Pause");
			    info.setDuration("32 secs");
			}
			info.setIndex(i+1);
			info.setEventDate("11/16/17");
			info.setEventTime("17:32");
			info.setBeats((i+2)+"");
			
			info.setAverage("158 bpm");
			info.setRange("150~171 bpm");
			info.setPtTriggerShow(true);
			if (i==0){
				info.setRateData1(getAfInfo());
				info.setRateData2(getAfInfo1());
			}
			
			if (i%2==0){
			    info.setPtTrigger(true);
	        	info.setDataList(getList());
	        }else{
	        	info.setPtTrigger(false);
	        	info.setDataList(getList1());
	        }
			
			lists.add(info);
		}
		
		ReportDetail detail=new ReportDetail();
		detail.setDetails(lists);
		detail.setRateData1(getAfInfo());
		detail.setRateData2(getAfInfo1());
		List<ReportDetail> details=new ArrayList<ReportDetail>();
		details.add(detail);
		return details;
	}
	
	
