	public static Map getRateData(){
		Map map=new HashMap();
		List datas=new ArrayList();
		for (int i=0;i<24;i++){
			datas.add(i);
			
		}
		map.put("dates", datas);
		List rates=new ArrayList();
		for (int j=0;j<8;j++){
			RateData rate=new RateData();
			rate.setRateIndex(j+1);
			rate.setMax(160);
			rate.setMin(70);
			rate.setAvg(90);
			rate.setDay(j);
			rates.add(rate);
		}
		map.put("rateList", rates);
		return map;
		
	}
	public static Map getRateData1(){
		Map map=new HashMap();
		List datas=new ArrayList();
		for (int i=0;i<8;i++){
			datas.add("10/1"+(i));
			
		}
		map.put("dates", datas);
		List rates=new ArrayList();
		for (int j=0;j<2;j++){
			RateData rate=new RateData();
			rate.setRateIndex(6+j*12);
			rate.setMax(160);
			rate.setMin(60);
			rate.setAvg(90);
			rate.setDay(j);
			rates.add(rate);
		}
		map.put("rateList", rates);
		return map;
		
	}
